  // let name = localStorage.getItem('name')
  // let str = `mailto:${email}`
  // let userObject = {
  //   "name": name,
  //   "email": email,
  //   "password": password, 
  // }

  return (
    <>
      <div style={{ fontSize: "3rem", textAlign: "center", margin: "1%" }}>Dashboard</div>
      <table>
        <tr>
          <th >Sno</th>
          <th onClick={sortOut()}>name</th>
          <th>Email</th>
        </tr>

        {users.map((item, ind) => (


          <tr>
            <td>{item.id}</td>
            <td>{item.name}</td>
            <td>{item.email}</td>
          </tr>

        ))}
      </table>


    </>
  )

};

export default Home;
